<script setup>
  import { gsap } from 'gsap'
  import { onBeforeUnmount, onMounted, ref } from 'vue'

  const polies = ref(null)

  const anim = () => {
    tl.to(polies.value, {
      rotate: 30,
      duration: 2.5,
      repeat: 1,
      yoyo: true,
    })
    tl.to(
      gsap.utils.shuffle(polies.value).slice(0, 10),
      {
